import { motion } from 'framer-motion';

function App() {
  const smoothScroll = (id) => {
    const yOffset = -100;
    const element = document.getElementById(id);
    const y = element.getBoundingClientRect().top + window.pageYOffset + yOffset;
    window.scrollTo({ top: y, behavior: 'smooth' });
  }

  const containerVariants = {
    hidden: { opacity: 0, y: 50 },
    visible: { opacity: 1, y: 0, transition: { delayChildren: 0.2, staggerChildren: 0.2 } },
  };

  const childVariants = {
    hidden: { opacity: 0, y: 50 },
    visible: { opacity: 1, y: 0 },
  };

  return (
    <div className="min-h-screen bg-gray-900 text-gray-300 font-sans relative" style={{ scrollPaddingTop: "4rem" }}>

      <header className="fixed top-0 left-0 right-0 w-full bg-black text-white p-4 shadow-lg z-10">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-3xl font-bold">AIAIC</h1>
          <nav className="flex space-x-4">
            {["Intro", "Vision", "Projects", "Members", "Contact"].map((section) => (
              <a
                key={section}
                role="button"
                aria-label={`Go to ${section} Section`}
                onClick={() => smoothScroll(`${section.toLowerCase()}-section`)}
                className="cursor-pointer hover:text-blue-400 focus:outline-none focus:text-blue-500 focus:ring focus:ring-blue-500"
              >
                {section}
              </a>
            ))}
          </nav>
        </div>
      </header>

      <motion.section className="pt-20 mt-16 bg-black text-white py-32 px-5" initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
        <div className="container mx-auto text-center">
          <motion.h2 className="text-6xl font-bold mb-8 leading-tight">Welcome to AIAIC</motion.h2>
          <motion.p className="text-2xl mb-12 mx-auto w-2/3 leading-relaxed">Your leading authority in artificial intelligence innovations</motion.p>
          <motion.a href="#!" role="button" aria-label="Learn more about AIAIC" whileHover={{ scale: 1.05 }} className="bg-blue-500 text-white py-2 px-8 rounded-full hover:bg-blue-600 transition duration-300 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500">Learn More</motion.a>
        </div>
      </motion.section>

      <main className="py-10 px-5">

        {[{
          id: "intro-section",
          title: "AI Council - Intro",
          content: "Founded in 2022, the All India Artificial Intelligence Council (AIAIC) was established with the goal of bringing together experts, researchers, and enthusiasts in the field of AI. As a premier organization, AIAIC serves as a platform for the exchange of knowledge, fostering collaborations, and setting standards in AI research and applications across India.",
          delay: 0.2
        }, {
          id: "vision-section",
          title: "Our Vision",
          content: "We envision a future where AI-driven technologies seamlessly integrate into every aspect of our lives, enhancing our day-to-day experiences, propelling businesses forward, and solving complex societal challenges. Through continuous education, research, and public-private partnerships, we aim to position India as a global leader in AI innovations and its ethical implementations.",
          delay: 0.4
        }].map(({ id, title, content, delay }) => (
          <motion.section key={id} id={id} className="my-24" initial={{ y: 50, opacity: 0 }} animate={{ y: 0, opacity: 1 }} transition={{ delay }}>
            <h2 className="text-4xl font-bold mb-10">{title}</h2>
            <p className="text-xl text-gray-400 leading-relaxed mx-auto w-2/3">
              {content}
            </p>
          </motion.section>
        ))}

        <motion.section id="members-section" variants={containerVariants} initial="hidden" animate="visible" className="my-24">
          <motion.h2 variants={childVariants} className="text-4xl font-bold mb-10">Members of AI Council</motion.h2>
          <motion.ul variants={childVariants} className="text-xl text-gray-400 leading-relaxed mx-auto w-2/3 space-y-3">
            <li>Dr. Archana Menon</li>
            <li>Prof. Kartik Nair</li>
            <li>Mr. Rahul Chopra</li>
            <li>Ms. Vaishali Oberoi</li>
          </motion.ul>
        </motion.section>

        <motion.section id="contact-section" className="my-24" initial={{ y: 50, opacity: 0 }} animate={{ y: 0, opacity: 1 }} transition={{ delay: 0.6 }}>
          <h2 className="text-4xl font-bold mb-10">Contact Us</h2>
          <p className="text-xl text-gray-400 leading-relaxed mx-auto w-2/3">
            For inquiries, collaborations, and other details, reach out to us at: <a href="mailto:contact@aiaic.org" className="underline text-blue-400 hover:text-blue-500">contact@aiaic.org</a>.
          </p>
        </motion.section>

      </main>

      <footer className="bg-black text-white py-12 mt-16">
        <div className="container mx-auto text-center">
          <p className="text-lg">&copy; 2023 All India Artificial Intelligence Council. All rights reserved.</p>
        </div>
      </footer>

    </div>
  );
}

export default App;
